import { Link, Outlet } from "react-router-dom";

const Navbar = (props) => {
  return (
    <div>
      <h1>I am Navbar</h1>
      <div>
        <Link to="/home/shop">Shop</Link>
      </div>
      <Outlet />
    </div>
  );
};

export default Navbar;
